INSERT INTO `fposts` VALUES (3, 1, 1, NULL, 'Baki the Grappler', 'baki-the-grappler', NULL, '[{\"type\":\"paragraph\",\"data\":{\"text\":\"The series was followed by three sequels in the same magazine;&nbsp;<i><b>Baki<\\/b><\\/i>&nbsp;(\\u30d0\\u30ad, officially romanized as&nbsp;<i>New Grappler Baki: In Search of Our Strongest Hero<\\/i>), which was serialized from 1999 to 2005 and collected into 31 volumes,&nbsp;<i><b>Baki Hanma<\\/b><\\/i>&nbsp;(\\u7bc4\\u99ac\\u5203\\u7259,&nbsp;<i>Hanma Baki<\\/i>, officially romanized as&nbsp;<i>Baki: Son of Ogre<\\/i>), which was serialized from 2005 to 2012 and collected into 37 volumes, and&nbsp;<i><b>Baki-Dou<\\/b><\\/i>&nbsp;(\\u5203\\u7259\\u9053,&nbsp;<i>Baki D\\u014d<\\/i>, lit. \\\"Baki\'s Style\\\"), which was serialized from 2014 to 2018 and collected into 22 volumes. A fifth series, also named&nbsp;<i><b>Baki Dou<\\/b><\\/i>&nbsp;(\\u30d0\\u30ad\\u9053,&nbsp;<i>Baki D\\u014d<\\/i>)&nbsp;but with Baki\'s name written in&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Katakana\\\">katakana<\\/a>&nbsp;instead of&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Kanji\\\">kanji<\\/a>, began on October 4, 2018.\"}},{\"type\":\"image\",\"data\":{\"file\":{\"url\":\"http:\\/\\/159.69.125.130\\/images\\/blog\\/original\\/\\/ysg8rDyURVBaki-Season-4-release-date-Netflixs-Baki-Son-of-Ogre-sequel-Baki-Hanma-manga-1024x576.jpg\"},\"caption\":\"Baki the grappler\",\"withBorder\":false,\"stretched\":true,\"withBackground\":false}},{\"type\":\"paragraph\",\"data\":{\"text\":\"Baki Hanma is raised by his wealthy mother, Emi Akezawa, who also funds his training in the hopes that he can be a powerful warrior like his father, Yujiro Hanma. Around the start of the series, Baki outgrows traditional training and heads out to follow the path of his ruthless father\'s training and meets many powerful fighters along the way. Eventually, Baki fights his father and is beaten without a challenge.\"}}]', NULL, 1, 'active', '2021-01-04 02:18:51', 0, 1, 1, -1, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-01-04 01:18:51', '2021-01-04 11:39:39');
