-- ----------------------------
-- View structure for user_with_friendcount
-- ----------------------------
DROP VIEW IF EXISTS `user_with_friendcount`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `user_with_friendcount` AS select count(friends.id) as count, users.id as user_id
from friends
LEFT JOIN users
on users.id=friends.active_user or users.id= friends.passive_user
GROUP BY user_id ;

-- ----------------------------
-- View structure for user_with_postcount
-- ----------------------------
DROP VIEW IF EXISTS `user_with_postcount`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `user_with_postcount` AS select users.*, bl.count as post_count, uf.count as friend_count
from users
LEFT JOIN (
		select count(id) as count, user_id
		from blogs
		group by user_id )
		as bl
on bl.user_id = users.id 
LEFT JOIN laravel.user_with_friendcount as uf
on uf.user_id = users.id ;

